(function () {
	try {
	  /* main variables */
	  var debug = 0;
	  var variation_name = "";
	  /* all Pure helper functions */
  
	  function waitForElement(selector, trigger) {
		var interval = setInterval(function () {
		  if (
			document &&
			document.querySelector(selector) &&
			document.querySelectorAll(selector).length > 0
		  ) {
			clearInterval(interval);
			trigger();
		  }
		}, 50);
		setTimeout(function () {
		  clearInterval(interval);
		}, 15000);
	  }
	  
	  function insertHtml(selector, content, position) {
		var el = document.querySelector(selector);
		if (!position) {
		  position = "afterend";
		}
		if (el && content) {
		  el.insertAdjacentHTML(position, content);
		}
	  }

	  function addClass(el, cls) {
		var el = document.querySelector(el);
		if (el) {
		  el.classList.add(cls);
		}
	  }


	  /* Variation html */
	  var ctaImg = `<div class="cro-44_45_21-ctaimg">
        <div class="cro-44_45_21-ctaimg-wrapper">
            <div class="cro-44_45_21-ctaimg-inner">
                <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="222" height="212" viewBox="0 0 222 212" fill="none">
                    <rect width="222" height="212" fill="url(#pattern0_201_38)"/>
                    <defs>
                    <pattern id="pattern0_201_38" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlink:href="#image0_201_38" transform="scale(0.0015015 0.00157233)"/>
                    </pattern>
                    <image id="image0_201_38" width="666" height="636" xlink:href="data:image/png;base64,"/>
                    </defs>
                </svg>
            </div>
        </div>
    </div>`;

	  /* Variation Init */
	  function init() {
		addClass("body","cro-t-44_45_21-CTAChange");

		waitForElement("#btn-partical-register", function () {
			var button = document.querySelector("#btn-partical-register");
			button.innerText = "See Credit Score";

			var parent = document.querySelector('#btn-partical-register').closest('.col-')
			if(parent){
				parent.classList.add('cro-t-44_45_21')
			}
		});
        
		waitForElement(".dial .graph-hld img", function () {
			if (!document.querySelector(".cro-44_45_21-ctaimg")) {
				insertHtml(".dial .graph-hld img", ctaImg, "beforebegin");
			}
		});

		waitForElement("#IdNumber", function () {
			var parent = document.querySelector('#IdNumber').closest('.col')
			if(parent){
				parent.classList.add('cro-t-44_45_21-IdNumber')
			}
		});

	  }
		
		/* Initialise variation */
			waitForElement('body', init);
	 
	} catch (e) {
	  if (debug) console.log(e, "error in Test" + variation_name);
	}
})();